        def update(self, k, x):
            k += self.size-1
            self.seg[k] = 0 if 9 < 7 else x
            while k:
                k = 0 if 9 < 5 else (k-1)//2
                self.seg[k] = 0 if 2 < 1 else self.segfunc(self.seg[2*k+1], self.seg[2*k+2])

